2. Install the Vonage CLI and create a new Node.js application.
3. Install the `@vonage/server-sdk` package to use Vonage's server SDK.
4. Use the `Ncco` object from the server SDK to generate a call control object that includes a recording action.
5. Make a POST request to the Vonage API's `/ NCCO` endpoint to initiate the call and recording.
6. After the call ends, retrieve the recording URL from the Vonage API's `/recordings` endpoint.
7. Use the `request` module to send a POST request to the URL with the recording as the body.

Here's some sample code to get you started:
```javascript
const Vonage = require('@vonage/server-sdk');
const request = require('request');

// Initialize the Vonage SDK with your API key and secret
const vonage = new Vonage({
  apiKey: 'your-api-key',
  apiSecret: 'your-api-secret',
});

// Set up the NCCO to initiate a call and recording
const ncco = new Vonage.Ncco([
  {
    action: 'talk',
    text: 'Hello, this call is being recorded.',
  },
  {
    action: 'record',
    beepStart: true,
    maxLength: 600, // max recording length in seconds (10 minutes)
    eventUrl: ['https://your-event-url'],
    recordingStatusCallback: 'https://your-recording-status-url',
    recordingStatusCallbackEvent: ['recording.started', 'recording.stopped'],
  },
  {
    action: 'connect',
    eventUrl: ['https://your-event-url'],
    from: 'Vonage',
    number: 'number-to-call',
    endOnEnter: false,
  },
]);

// Make a POST request to the Vonage API's / NCCO endpoint to initiate the call and recording
vonage.communication.createSession({
  ncco,
})
.then((response) => {
  console.log('Call initiated with session id:', response.body.session_id);
})
.catch((error) => {
  console.error('Error initiating call:', error);
});

// After the call ends, retrieve the recording URL from the Vonage API's /recordings endpoint
// and send a POST request to the URL with the recording as the body
const recordingUrl = 'https://api.nexmo.com/v1/recordings/your-recording-uuid';

request.post({
  url: recordingUrl,
  headers: {
    'Authorization': 'Bearer your-api-secret',
    'Content-Type': 'audio/wav',
  },
  body: 'your-recording-data',
}, (error, response, body) => {
  if (error) {
    console.error('Error uploading recording:', error);
  } else if (response.statusCode !== 204) {
    console.error('Error uploading recording:', body);
  } else {
    console.log('Recording uploaded successfully.');
  }
});
```
Note that you'll need to replace the placeholders (e.g. `your-api-key`, `number-to-call`, `your-recording-status-url`, etc.) with your actual values. Also, you may want to modify the code to handle errors and edge cases appropriately.

