["The `data-*` attributes are used to store custom data on HTML elements. The `dataset` property provides a convenient way to access and manipulate these data attributes in JavaScript. To remove a specific `data-*` attribute, you can use the `removeAttribute` method or update the value to an empty string.

Here's an example of how you can remove a `data-my-custom-attribute` from an HTML element using JavaScript:

```javascript
// Get the element
const element = document.getElementById('my-element');

// Remove the attribute using removeAttribute
element.removeAttribute('data-my-custom-attribute');

// Alternatively, set the value to an empty string
element.dataset.myCustomAttribute = '';
```

If you want to remove all `data-*` attributes from an element, you can use a loop to iterate over the dataset and remove each attribute.

```javascript
// Get the element
const element = document.getElementById('my-element');

// Loop over the dataset and remove each attribute
for (const attr in element.dataset) {
  element.removeAttribute(attr);
}
```

Remember that the `removeAttribute` method will completely remove the attribute from the element, whereas setting the value to an empty string with `dataset.attr = ''` will keep the attribute but remove its value."]

