```cpp
#include <iostream>
#include <cuda.h>

#define N 100

void matrixMultiplication(float* A, float* B, float* C, int M, int N, int K) {
    dim3 blockSize(16, 16);
    dim3 numBlocks((N + blockSize.x - 1) / blockSize.x, (K + blockSize.y - 1) / blockSize.y);

    float* d_A = new float[M * N];
    float* d_B = new float[K * N];
    float* d_C = new float[M * K];
    cudaMalloc((void**)&d_A, M * N * sizeof(float));
    cudaMalloc((void**)&d_B, K * N * sizeof(float));
    cudaMalloc((void**)&d_C, M * K * sizeof(float));

    cudaMemcpy(d_A, A, M * N * sizeof(float), cudaMemcpyHostToDevice);
    cudaMemcpy(d_B, B, K * N * sizeof(float), cudaMemcpyHostToDevice);

    matrixMultiplicationKernel<<<numBlocks, blockSize>>>(d_A, d_B, d_C, M, N, K);

    cudaMemcpy(C, d_C, M * K * sizeof(float), cudaMemcpyDeviceToHost);
    cudaFree(d_A);
    cudaFree(d_B);
    cudaFree(d_C);
}

__global__ void matrixMultiplicationKernel(float* A, float* B, float* C, int M, int N, int K) {
    int i = blockIdx.y * blockDim.y + threadIdx.y;
    int j = blockIdx.x * blockDim.x + threadIdx.x;
    if (i < M && j < K) {
        float sum = 0;
        for (int k = 0; k < N; k++) {
            sum += A[i * N + k] * B[k * K + j];
        }
        C[i * K + j] = sum;
    }
}

int main() {
    float A[N * N], B[N * N], C[N * N];

    // Fill the matrices A and B with random values
    for (int i = 0; i < N * N; i++) {
        A[i] = i;
        B[i] = i;
    }

    // Call matrix multiplication function
    matrixMultiplication(A, B, C, N, N, N);

    // Fill the result matrix C with random values
    for (int i = 0; i < N * N; i++) {
        C[i] = i;
    }

    // Print the result matrix C
    for (int i = 0; i < N * N; i++) {
        std::cout << C[i] << " ";
        if ((i + 1) % N == 0) {
            std::cout << std::endl;
        }
    }

    return 0;
}
```

This code defines a function `matrixMultiplication` that takes three matrices as input and performs the matrix multiplication using CUDA. The function first allocates memory on the GPU for the input matrices and initializes them with random values. Then, it calls the `matrixMultiplicationKernel` kernel function to perform the matrix multiplication. Finally, it copies the result back to the CPU and prints the resulting matrix."]

