	ComfyUIWidget->OnSaveModel.AddRaw(StabilityMatrix, &FStabilityMatrix::SaveModel);
	ComfyUIWidget->OnGenerateImage.AddRaw(StabilityMatrix, &FStabilityMatrix::GenerateImage);
	ComfyUIWidget->OnCancelImage.AddRaw(StabilityMatrix, &FStabilityMatrix::CancelImage);

