	StabilityMatrix->OnImageCancelled.AddRaw(ComfyUIWidget, &UComfyUINodeEditorWidget::ImageCancelled);
	StabilityMatrix->OnError.AddRaw(ComfyUIWidget, &UComfyUINodeEditorWidget::ShowError);
}

void FUnrealComfyPlugin::ConnectStabilityMatrixAndUnrealEngine()
{
	// Get the Unreal Engine editor viewport
	EditorViewport = GEditor->GetActiveViewport()->GetClient();

	// Bind the Stability Matrix event to the Unreal Engine function
	StabilityMatrix->OnImageGenerated.AddRaw(this, &FUnrealComfyPlugin::GenerateAndDisplayImage);
