void FUnrealComfyPlugin::GenerateAndDisplayImage()
{
	// Get the image data from the Stability Matrix
	TArray<uint8> ImageData = StabilityMatrix->GetImageData();

	// Create a texture from the image data
	GeneratedImage = UTexture2D::CreateTransient(512, 512); // Assuming the image size is 512x512
	FTexture2DMipMap& Mip = GeneratedImage->PlatformData->Mips[0];
	void* Data = Mip.BulkData.Lock(LOCK_READ_WRITE);
	FMemory::Memcpy(Data, ImageData.GetData(), ImageData.Num());
	Mip.BulkData.Unlock();
	GeneratedImage->UpdateResource();

	// Create a render target from the texture
	UTextureRenderTarget2D* RenderTarget = NewObject<UTextureRenderTarget2D>();
	RenderTarget->RenderTargetFormat = ETextureRenderTargetFormat::RTF_RGBA8;
	RenderTarget->InitAutoFormat(512, 512); // Assuming the image size is 512x512
	RenderTarget->UpdateResourceImmediate(true);
	RenderTarget->TextureReference.TextureReferenceRHI = GeneratedImage->TextureReference.TextureReferenceRHI;

	// Set the render target as the editor viewport's render target
	EditorViewport->SetRenderTargetOverride(RenderTarget, nullptr);
}

