["To resolve the runtime warning and send messages from a non-platform thread to Flutter, you can use a task queue or a message looper to ensure that the message is sent on the platform thread. Here's an example using a task queue:

1. Create a task queue for sending messages:
```cpp
#include <queue>
#include <mutex>
#include <condition_variable>

static std::queue<std::string> messageQueue;
static std::mutex messageMutex;
static std::condition_variable messageConditionVariable;

void sendMessageFromTaskQueue(const std::string& message) {
  std::unique_lock<std::mutex> lock(messageMutex);
  messageQueue.push(message);
  lock.unlock();
  messageConditionVariable.notify_one();
}
```
1. Modify your `sendMessage()` function to send messages to the task queue instead:
```cpp
void sendMessage() {
  std::thread([](std::unique_ptr<NodeBaseEventChannelHandler> handler) {
    // Do some work...
    std::string message = "your message";
    sendMessageFromTaskQueue(message);
  }, std::move(eventHandler)).detach();
}
```
1. Add a message looper on the platform thread to process messages from the task queue:
```cpp
#include <thread>

void startMessageLooper() {
  std::thread([](std::unique_ptr<NodeBaseEventChannelHandler> handler) {
    while (true) {
      std::unique_lock<std::mutex> lock(messageMutex);
      messageConditionVariable.wait(lock, [] { return !messageQueue.empty(); });

      std::string message = messageQueue.front();
      messageQueue.pop();

      lock.unlock();

      handler->postMessage(message);
    }
  }, std::move(eventHandler)).detach();
}

// Call startMessageLooper() from the platform thread where you initialize your plugin.
```
This way, your non-platform thread sends messages to the task queue, and the message looper running on the platform thread dequeues and sends the messages using `postMessage()`. This ensures that all messages are sent from the platform thread, avoiding the runtime warning and potential data loss or crashes."]

