  @JsonKey(fromJson: _fromTimestamp, toJson: _toTimestamp)
  DateTime date;

  static DateTime _fromTimestamp(int timestamp) => DateTime.fromMillisecondsSinceEpoch(timestamp);
  static int _toTimestamp(DateTime date) => date.millisecondsSinceEpoch;
}
```

Then the generated code will use those _fromTimestamp and _toTimestamp methods to convert between DateTime and the integer timestamp format.

So your full code would be:

```dart
import 'package:json_annotation/json_annotation.dart';

part 'my_model.g.dart';

@JsonSerializable()
class MyModel {
  @JsonKey(fromJson: _fromTimestamp, toJson: _toTimestamp)
  DateTime date;

  static DateTime _fromTimestamp(int timestamp) => DateTime.fromMillisecondsSinceEpoch(timestamp);
  static int _toTimestamp(DateTime date) => date.millisecondsSinceEpoch;
}

